// Define the features array as a LabeledPoint.  Select only relevant features

val mldata = flightsRDD.map { flight =>
    LabeledPoint(
      if (flight.depdelaymins > 40) 1.0 else 0.0,
      Vectors.dense(
          flight.dofM.toDouble - 1,           // day of month
          flight.dofW.toDouble - 1,           // day of week
          flight.crsdeptime,                  // departure time
          flight.crsarrtime,                  // arrival time
          carrierMap(flight.carrier).toDouble,// carrier
          flight.crselapsedtime,              // elapsed flight time
          originMap(flight.origin).toDouble,  // departure city
          destMap(flight.dest).toDouble       // arrival city
      )
    )
}.cache()

// Partition the data into training and test data sets

// mldata0 is %85 not delayed flights
val mldata0 = mldata.filter(x => x.label == 0).randomSplit(Array(0.85, 0.15))(1)
// mldata1 is %100 delayed flights
val mldata1 = mldata.filter(x => x.label != 0)
// mldata2 is delayed and not delayed
val mldata2 = mldata0 ++ mldata1

//  split mldata2 into training and test data
val splits = mldata2.randomSplit(Array(0.7, 0.3))
val (trainingData, testData) = (splits(0), splits(1))

%angular

<div id="tree" style="height: 800px; width: 100%"></div>

<style>
.node circle {
  fill: #fff;
  stroke: steelblue;
  stroke-width: 3px;
}

.node text { font: 12px sans-serif; }

.link {
  fill: none;
  stroke: #ccc;
  stroke-width: 2px;
}
</style>

<script>
var margin = {top: 20, right: 120, bottom: 20, left: 120},
	width  = 800 - margin.right - margin.left,
	height = 480 - margin.top - margin.bottom;

var i = 0;

var tree = d3.layout.tree()
	.size([height, width]);

var diagonal = d3.svg.diagonal()
	.projection(function(d) { return [d.y, d.x]; });

var svg = d3.select("tree").append("svg")
	.attr("width", width + margin.right + margin.left)
	.attr("height", height + margin.top + margin.bottom)
    .append("g")
	.attr("transform", "translate(" + margin.left + "," + margin.top + ")");

// load the external data
//d3.json(${result}, function(error, treeData) {
//  root = treeData[0];
//  update(root);
//});

var root = angular.element($("#tree")).scope().compiledScope.treeData[0];

update(root);

function update(source) {

  // Compute the new tree layout.
  var nodes = tree.nodes(root).reverse(),
	  links = tree.links(nodes);

  // Normalize for fixed-depth.
  nodes.forEach(function(d) { d.y = d.depth * 180; });

  // Declare the nodes…
  var node = svg.selectAll("g.node")
	  .data(nodes, function(d) { return d.id || (d.id = ++i); });

  // Enter the nodes.
  var nodeEnter = node.enter().append("g")
	  .attr("class", "node")
	  .attr("transform", function(d) { 
		  return "translate(" + d.y + "," + d.x + ")"; });

  nodeEnter.append("circle")
	  .attr("r", 10)
	  .style("fill", "#fff");

  nodeEnter.append("text")
	  .attr("x", function(d) { 
		  return d.children || d._children ? -13 : 13; })
	  .attr("dy", ".35em")
	  .attr("text-anchor", function(d) { 
		  return d.children || d._children ? "end" : "start"; })
	  .text(function(d) { return d.name; })
	  .style("fill-opacity", 1);

  // Declare the links…
  var link = svg.selectAll("path.link")
	  .data(links, function(d) { return d.target.id; });

  // Enter the links.
  link.enter().insert("path", "g")
	  .attr("class", "link")
	  .attr("d", diagonal);
}

</script>

// define the Flight Schema
case class Airport(iata: String, lat: Double, lon: Double)

def parseAirport(str: String): Airport = {
    val line = str.split(",")
    Airport(line(6)         , line(1).toDouble , line(2).toDouble)
}

val airportsRDD = sc.textFile("data/airports3.csv")
      .flatMap { line =>
        Try { parseAirport(line) }.toOption
      }.cache()
airportsRDD.toDF().registerTempTable("airportsRDD")


println(s"Number of airports with a IATA code: ${"%d".format(airportsRDD.count())}")

%angular

<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.7/leaflet.css" />
<div id="map" style="height: 800px; width: 100%"></div>

<script type="text/javascript">
function initMap() {
    var map = L.map('map', {scrollWheelZoom: false}).setView([37.09, -95.71], 5);

    L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        attribution: 'Map data &copy; <a href="http://openstreetmap.org">OpenStreetMap</a> contributors',
        maxZoom: 12,
        minZoom: 2
    }).addTo(map);

    var geoMarkers = L.layerGroup().addTo(map);

    var airports = = angular.element($("#map")).scope().compiledScope.airports;

    airports.forEach(function(airport){
        // Marker
        //L.marker([d.values[2], airport.values[3]]).addTo(map).bindPopup("<b>"+airports.values[1]+"</b><br/>"+airports.values[0]).openPopup();
        // Circle
        L.circle([airport.values[2], airport.values[3]], 1000, {
            weight: airport.values[0],
            color: "blue",
            fillColor: "#f03",
            fillOpacity: 1
        }).addTo(map).bindPopup("<b>"+airport.values[1]+"</b><br/>"+airport.values[0]).openPopup();
    });
}

if (window.locationWatcher) {
    // clear existing watcher otherwise we'll have duplicates
    window.locationWatcher();
}

// ensure we only load the script once, seems to cause issues otherwise
if (window.L) {
    initMap();
} else {
    console.log('Loading Leaflet library');
    var sc = document.createElement('script');
    sc.type = 'text/javascript';
    sc.src = 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.7/leaflet.js';
    sc.onload = initMap;
    sc.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(sc);
}
</script>
